  false,\n\t\"url\": null,\n\t\"notes\": \"The report titled RECA Awards by Place
  of Residence (State/Country) as of [current date], reflects the number of claims
  filed, pending, denied, approved, and compensation awarded, based on the state and
  in certain cases, the country of the individual claimant. It is important to note
  that the data (state and country) reflects the residency of the claimant receiving
  the compensation awards; it does not reflect the location where the individual was
  exposed. For example, many claimants were exposed to radiation while present in
  the Southwestern United States. However, the report reflects that compensation awards
  were sent to residents of many states and countries. Moreover, in cases involving
  multiple beneficiaries, the data reflects the residency of the lead beneficiary,
  i.e., the individual who completed the claim form.\",\n\t\"license_title\": \"License
